import React from "react";
import {NavLink} from "react-router-dom";
import {Link} from 'react-scroll';
import { useTranslation } from 'react-i18next';

const options = {
  spy: true,
  smooth: true,
  duration: 500,
};

const Menu = ({toggleMenu}) => {
  const { t } = useTranslation();
  return (

    <div className="o-col t-site-header__menu">
      <ul className="c-nav">
          <li className="c-btn c-btn--start c-nav__item c-heading--level4 e-alignCenter">
            <NavLink exact to="/"><Link to="t-site-header" {...options} tabIndex="0" onClick={toggleMenu}>
              t{Start}
              </Link></NavLink>
          </li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">
            <Link to="t-our-path" {...options} tabIndex="0" onClick={toggleMenu}>
              O co chodzi
            </Link>
          </li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">
            <Link to="t-about-us" {...options} tabIndex="0" onClick={toggleMenu}>
            O nas
            </Link>
          </li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">
            <Link to="t-help"  {...options} tabIndex="0" onClick={toggleMenu}>
            Fundacje i  organizacje
            </Link>
          </li>
          <li className="c-btn c-nav__item c-heading--level4 e-alignCenter">
            <Link to="t-contact-form"  {...options} tabIndex="0" onClick={toggleMenu}>
            Kontakt
            </Link>
          </li>
      </ul>
    </div>
  )
}

export default Menu;
